% Tolerância para a convergência
tol = 1e-6;

% Número máximo de iterações
max_iter = 1000;

function x = gauss_seidel(A, b, tol, max_iter)
    % A: matriz dos coeficientes
    % b: vetor de termos constantes
    % tol: tolerância para a convergência
    % max_iter: número máximo de iterações

    n = length(b);
    x = zeros(n, 1);  % Inicializa x com zeros
    x_prev = x;       % Vetor para armazenar o valor de x na iteração anterior

    for k = 1:max_iter
        for i = 1:n
            sum1 = 0;
            sum2 = 0;

            % Soma os elementos anteriores de x
            for j = 1:i-1
                sum1 = sum1 + A(i,j) * x(j);
            end

            % Soma os elementos posteriores de x
            for j = i+1:n
                sum2 = sum2 + A(i,j) * x_prev(j);
            end

            % Atualiza o valor de x(i)
            x(i) = (b(i) - sum1 - sum2) / A(i,i);
        end

        % Verifica a convergência
        if norm(x - x_prev, inf) < tol
            disp(['Convergência alcançada após ', num2str(k), ' iterações.']);
            return;
        end

        % Atualiza x_prev para a próxima iteração
        x_prev = x;
    end

    disp('Número máximo de iterações atingido.');
end


